import React, { Component } from 'react';
import Title from './Title'

class Main extends Component {
    render() {
        return <div>
            <Title title={"Hello world"} />
            <List tasks={['hose the driveway', 'finish the laundry']} />
            <List tasks={['Mow the low', 'walk the dog']} />
        </div>
    }
}
export default Main;
